var contactoUrl=global_settings.urlCORS+"api/contactoapi/";registrationModule.factory("contactoRepository",function(t){return{getAll:function(){return t.get(contactoUrl+"0")},getAuto:function(){return t.get(contactoUrl+"1")},getEmpty:function(){return t.get(contactoUrl+"2")},add:function(o){return t.post(contactoUrl,o)},"delete":function(o){return t.get(contactoUrl+"3-"+o)},update:function(o){return t.put(contactoUrl,o)}}});